  {"id": "6108", "name": "قمصان داخلية وتنانير داخلية أخر سراويل داخلية قصيرة وسراويل داخلية،  قمصان للنوم، بيجامات، ألبسة منزلية فضفاضة، برانس حمام، وزرة وأصناف مماثلة للنساء أو البنات، من مصنرات أو كروشيه"},
