  {"id": "6115", "name": "جوارب نسائية بسراويل (كولون) وجوارب نسائية ضيقة لا تغطي القدم وجوارب نسائيه طويلة أو نصفية و جوارب قصيرة  أو طويلة الساق وغيرها من أصناف تكسو الأرجل أو الأقدام، بما فيها الجوارب المتدرجة الضغط (مثل جوارب تمدد الأوردة)  وألبسة الأقدام بدون نعال, من مصنرات"},
