  {"id": "8418", "name": "ثلاجات (برادات) ومجمدات(فريزرات) وغيرها من آلات ومعدات وأجهزة التبريد أوالتجميد، كهربائية أوغير كهربائية؛ مضخات حرارية، عدا آلات وأجهزة تكييف الهواء الداخلة في البند 8415"},
  {"id": "8205", "name": "عدد يدوية (بما فيها القواطع الماسية للزجاج)، غير مذكورة ولا داخلة في مكان آخر؛ مواقد اللحام؛ ملزمات ومرابط وما يماثلها، عدا تلك التي تعتبر أجزاء ولوازم للعدد الآلية؛ سنادين؛ أكوار حدادة قابلة للنقل؛ دواليب شحذ بهياكلها تدار باليد أو بالقدم"},
