  {"id": "8301", "name": "أقفال ومغاليق (بمفاتيح أو بتركيبات حروف أو أرقام أو مما يفتح بالكهرباء)، من معادن عادية؛ مشابك (ابازيم) وأطر بمشابك محتوية على أقفال، من معادن عادية؛ مفاتيح للأصناف السابقة، من معادن عادية"},
