  {"id": "6401", "name": "أحذية كتيمة للماء بنعال خارجية ووجوه من مطاط أو من لدائن، وجوهها غير مثبتة على النعل الخارجي ولا مجمعة بالخياطة أو بمسامير برشام أو بمسامير عادية أو ببراغي أو بعمليات مماثلة"},
