  {"id": "6107", "name": "سراويل داخلية (كالسونات أو سليبات)، قمصان للنوم، بيجامات، برانس حمام، أرواب دي شامبر، وأصناف مماثلة للرجال أو الصبية، من مصنرات أو كروشيه"},
