  {"id": "8518", "name": "مذياعات للصوت (ميكروفونات)وحواملها؛ مكبرات صوت وإن كانت مركبة في هياكلها؛سماعات رأس أو سماعات أذن، وان كانت متحدة بمذياعات ومجموعات مكونة من مذياع (ميكروفون) وواحد أو أكثر من مكبرات الصوت؛ مضخمات كهربائية للذبذبات السمعية؛ مجموعات كهربائية لتضخيم الصوت"},
  {"id": "7018", "name": "خرز زجاجي و لآلئ مقلدة و أحجار كريمة أو شبه كريمة مقلدة وما يماثلها من منتجات صناعة الخرز الزجاجي، ومصنوعاتها، عدا حلي الغواية (المقلدة)؛ عيون من زجاج، عدا العيون الاصطناعية للبشر؛ تماثيل صغيرة وغيرها من أصناف الزينة من زجاج مشغول بنفخ اللهب، عدا حلي الغو"},
  {"id": "9608", "name": "أقلام حبر جاف؛ أقلام وأقلام تأشير برؤوس من لباد أو بغيرها من رؤوس مسامية؛ أقلام حبر سائل بأنواعها؛ أقلام حبر للنسخ؛ أقلام رصاص بخزان؛ ماسكات ريش كتابة وماسكات أقلام رصاص وأصناف مماثلة؛ أجزاء (بما فيها الأغطية والمشابك) للأصناف السابقة، عدا تلك الداخلة في"},
  {"id": "4419", "name": "أدوات مائدة وأدوات مطبخ، من خشب"},
  {"id": "7615", "name": "أدوات مائدة أو أدوات مطبخ أو غيرها من الأدوات المنزلية  وأجزاؤها، من ألومونيوم؛ إسفنجات و وسيدات وقفازات وما يماثلها  من ألومونيوم، للجلي أو للتلميع أو لاستعمالات مماثلة؛ أدوات صحية وأجزاؤها من ألمونيوم"},
  {"id": "7117", "name": "حلي غواية (مقلدة)"},
  {"id": "7607", "name": "أوراق من ألومونيوم (وإن كانت مطبوعة أو مثبتة على حامل أو ورق أو ورق مقوى أو لدائن أو على حوامل مماثلة) لا يتجاوز سمكها (باستثناء سمك أي حامل) 02 مم"},
  {"id": "8428", "name": "آلات وأجهزة أخر للرفع أوللتنضيد أو للتحميل أوللتفريغ (مثل، المصاعد والسلالم المتحركة والسيور الناقلة والناقلات السلكية ""تلفريك "")"},
  {"id": "3921", "name": "ألواح وصفائح ولفات وأشرطة وقدد أُخر، من اللدائن"},
  {"id": "8306", "name": "أجراس ونواقيس  وما يماثلها، غير كهربائية   من معادن عادية؛ تماثيل صغيرة وأصناف أُخر للتزيين من معادن عادية؛ أطر للصور الفوتوغرافية أو اللّوحات أو ما يماثلها، من معادن عادية؛ مرايا من معادن عادية"},
