  {"id": "7616", "name": "مصنوعات أُخر من ألمونيوم"},
  {"id": "9018", "name": "أدوات وأجهزة للطب أو الجراحة أو طب الأسنان أو الطب البيطري، بما فيها أجهزة التشخيص بالوميض الاشعاعي (سنتجراف) وغيرها من أجهزة الطب الكهربائية وكذلك أجهزة اختبار النظر"},
