  {"id": "3304", "name": "محضرات تجميل أو زينة (مكياج) ومحضرات للعناية بالبشرة (غير الأدوية)، بما فيها محضرات الوقاية من الشمس ومحضرات التسمير(برونزي)؛ محضرات العناية بأظافر الأيدي والأقدام"},
  {"id": "6006", "name": "أقمشة مصنرة أو كروشيه أخر."},
  {"id": "6912", "name": "أواني و أدوات للمائدة أو المطبخ، وأدوات منزلية أخر وأصناف للعناية بالنظافة الشخصية ( للتواليت)، من مواد خزفية أخر، عدا البورسلين أو الصيني"},
  {"id": "6214", "name": "شالات، أوشـحة، لفافات عنق، مناديل رأس (حجابات)"},
  {"id": "7010", "name": "قوارير ضخمه (دمجانات)، و قناني،  ودوارق، وبرطمانات وقدر وأنابيب وغيرها من الأوعية المماثلة من زجاج، لنقل أو تعبئة السلع؛ برطمانات حفظ من زجاج؛ سدادات و أغطية و غالقات أخر من زجاج"},
